foreach ($terms as $id => $title)
{

	$html_filename = $basedir . '/' . strtolower($id) . '.html';
	
	if (!file_exists($html_filename))
	{		
		$parameters = array(
			'hl' 		=> 'en',
			'as_sdt' 	=> '0.5',
			'q'			=> '"' . $title . '"',
			'btnG'		=> ''
			);
		
		$url = 'https://scholar.google.com/scholar?' . http_build_query($parameters);
		
		// call API
		$html = get($url);
	
		file_put_contents($html_filename, $html);
		
		// Give server a break 
    	$rand = rand(10000000, 30000000);
    	echo "\n-- ...sleeping for " . round(($rand / 1000000),2) . ' seconds' . "\n\n";
    	usleep($rand);		
	}
}

